informacaoComplementar:
O uso de projetores é instrumento indispensável para a didática moderna, possibilitando a exposição de apresentações, vídeos e demais materiais audiovisuais indispensáveis à compreensão dos conteúdos ministrados, o que contribui significativamente para a qualidade do ensino e para o aperfeiçoamento dos servidores deste Tribunal de Justiça do Estado do Piauí;

A aquisição de 2 (dois) projetores fundamenta-se na necessidade de continuidade das atividades com viés pedagógico, já que possibilita o uso simultâneo desses materiais em diferentes eventos, atendendo às programações previamente planejadas e estabelecidas;

Ademais, diante da necessidade exposta pela Escola Judiciária do Piauí, referente  a aquisição de projetores necessários para a realização de atividades pedagógicas promovidas pela EJUD às Unidades integrantes do TJPI, justifica-se a aquisição dos materiais com maior brevidade possível;

Ainda, os projetores serão utilizados no auditório e em uma das salas da EJUD, ambientes que possuem uma iluminação que ofusca a luminosidade dos projetores atuais, o que demanda a aquisição de novos projetores com maior capacidade de brilho (lumens);

Por todo o exposto, entende-se como configurado o interesse público na presente contratação.

objetoCompra:
- Módulo principal MASTERKEY 8ED;
- Módulo remoto IR WIFI;
- Sensor de temperatura e umidade Modbus;
- Módulo de detecção de líquido;
- Cordão de detecção de líquido;
- Sensor de detecção de fumaça;
- Fechadura eletrônica com acionamento por biometria digital com senha;
- Prestação de serviços de instalação da fechadura eletrônica, configuração e treinamento operacional da solução de monitoramento e automação de equipamentos de ar-condicionado (Rio Branco - AC).
